import { INSERIR_CONTATO, CONTATO_IS_LOADING } from "../actions/types";

export function contatoIsLoading(state = false, action) {
  const { type, isLoading } = action;

  switch (type) {
    case CONTATO_IS_LOADING:
      return isLoading;

    default:
      return state;
  }
}

export function inserirContato(state = null, action) {
  return "deu bom";
}
